describe("ResetBoard", () => {
  describe("Reset Form", () => {
    it("has a reset Rows input", () => {
      cy.visit("/");
      cy.get("input[name='reset-rows']");
    });

    it("has a reset Cols input", () => {
      cy.visit("/");
      cy.get("input[name='reset-cols']");
    });

    it("has a reset Mines input", () => {
      cy.visit("/");
      cy.get("input[name='reset-mines']");
    });
  });

  describe("Reset Game", () => {
    it("resets the board when the reset button is clicked", () => {
      cy.visit("/");
      cy.resetBoard("2", "2", "1");
      cy.get(".row").should("have.length", 2);
      cy.get(".col").should("have.length", 4);
      cy.get("p.elapsed-time")
        .invoke("text")
        .should("eq", "0");
    });

    it("resets Mines", () => {
      cy.resetBoard("5", "5", "10");
      cy.get(".reset-container button").click();
      cy.get(".mines")
        .invoke("text")
        .should("eq", "10");
    });

    it("resets safeCells", () => {
      cy.resetBoard("3", "3", "3");
      cy.get(".safe-cells")
        .invoke("text")
        .should("eq", "6");
    });

    it("resets Timer", () => {
      cy.resetBoard("3", "3", "3");
      cy.get(".elapsed-time")
        .invoke("text")
        .should("eq", "0");
    });
  });
});
